  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`This page covers installing Vector from source using the native toolchain for
the host.`}</p>
    <p>{`Vector can also be compiled to a static binary for Linux for `}<inlineCode parentName="p">{`x86_64`}</inlineCode>{`, `}<inlineCode parentName="p">{`ARM64`}</inlineCode>{`,
and `}<inlineCode parentName="p">{`ARMv7`}</inlineCode>{` architectures. See `}<a parentName="p" {...{
        "href": "#compiling-using-docker"
      }}>{`compiling using Docker`}</a>{`
for details.`}</p>


    <Alert type="warning" mdxType="Alert">
      <p>{`We recommend installing Vector through a supported `}<a parentName="p" {...{
          "href": "/docs/setup/installation/platforms/"
        }}>{`platform`}</a>{`,
`}<a parentName="p" {...{
          "href": "/docs/setup/installation/package-managers/"
        }}>{`package manager`}</a>{`, or pre-built
`}<a parentName="p" {...{
          "href": "/docs/setup/installation/manual/from-archives/"
        }}>{`archive`}</a>{`, if possible. These handle permissions, directory
creation, and other intricacies covered in the `}<a parentName="p" {...{
          "href": "#next-steps"
        }}>{`Next Steps`}</a>{`
section.`}</p>
    </Alert>
    {
      /*
          THIS FILE IS AUTOGENERATED!
           To make changes please edit the template located at:
           website/docs/setup/installation/manual/from-source.md.erb
      */
    }
    <h2 {...{
      "id": "installation"
    }}>{`Installation`}</h2>
    <Tabs block={true} defaultValue="linux" values={[{
      label: 'Linux',
      value: 'linux'
    }, {
      label: 'Windows',
      value: 'windows'
    }, {
      label: 'Docker',
      value: 'docker'
    }]} mdxType="Tabs">
      <TabItem value="linux" mdxType="TabItem">
        <p>{`The following steps should be used to compile Vector directly on Linux based systems.`}</p>
        <Steps headingDepth={3} mdxType="Steps">
          <ol>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "install-rust"
              }}>{`Install Rust`}</h3>
              <pre parentName="li"><code parentName="pre" {...{
                  "className": "language-bash"
                }}>{`curl --proto '=https' --tlsv1.2 -sSf https://sh.rustup.rs | sh -s -- -y --default-toolchain stable
`}</code></pre>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "install-compilation-dependencies"
              }}>{`Install compilation dependencies`}</h3>
              <p parentName="li">{`Install C and C++ compilers (GCC or Clang) and GNU `}<inlineCode parentName="p">{`make`}</inlineCode>{` if they are not
pre-installed on your system.`}</p>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "download-vectors-source"
              }}>{`Download Vector's Source`}</h3>
              <Tabs className="mini" defaultValue="latest" values={[{
                label: 'Latest (0.9.2)',
                value: 'latest'
              }, {
                label: 'Master',
                value: 'master'
              }]} mdxType="Tabs">
                <TabItem value="latest" mdxType="TabItem">
                  <pre parentName="li"><code parentName="pre" {...{
                      "className": "language-bash"
                    }}>{`mkdir -p vector && \\
  curl -sSfL --proto '=https' --tlsv1.2 https://api.github.com/repos/timberio/vector/tarball/v0.9 | \\
  tar xzf - -C vector --strip-components=1
`}</code></pre>
                </TabItem>
                <TabItem value="master" mdxType="TabItem">
                  <pre parentName="li"><code parentName="pre" {...{
                      "className": "language-bash"
                    }}>{`mkdir -p vector && \\
  curl -sSfL --proto '=https' --tlsv1.2 https://github.com/timberio/vector/archive/master.tar.gz | \\
  tar xzf - -C vector --strip-components=1
`}</code></pre>
                </TabItem>
              </Tabs>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "change-into-the-vector-directory"
              }}>{`Change into the `}<inlineCode parentName="h3">{`vector`}</inlineCode>{` directory`}</h3>
              <pre parentName="li"><code parentName="pre" {...{
                  "className": "language-bash"
                }}>{`cd vector
`}</code></pre>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "compile-vector"
              }}>{`Compile Vector`}</h3>
              <pre parentName="li"><code parentName="pre" {...{
                  "className": "language-bash"
                }}>{`[FEATURES="<flag1>,<flag2>,..."] make build
`}</code></pre>
              <p parentName="li">{`The `}<inlineCode parentName="p">{`FEATURES`}</inlineCode>{` environment variable is optional. You can override the
default features with this variable. See `}<a parentName="p" {...{
                  "href": "#feature-flags"
                }}>{`feature flags`}</a>{`
for more info.`}</p>
              <p parentName="li">{`When finished, the vector binary will be placed in
`}<inlineCode parentName="p">{`target/<target>/release/vector`}</inlineCode>{`. For example, if you are building Vector
on your Mac, your target triple is `}<inlineCode parentName="p">{`x86_64-apple-darwin`}</inlineCode>{`, and the Vector
binary will be located at `}<inlineCode parentName="p">{`target/x86_64-apple-darwin/release/vector`}</inlineCode>{`.`}</p>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "start-vector"
              }}>{`Start Vector`}</h3>
              <p parentName="li">{`Finally, start vector:`}</p>
              <pre parentName="li"><code parentName="pre" {...{
                  "className": "language-bash"
                }}>{`target/<target>/release/vector --config config/vector.toml
`}</code></pre>
            </li>
          </ol>
        </Steps>
      </TabItem>
      <TabItem value="windows" mdxType="TabItem">
        <p>{`The steps to compile Vector on Windows are different from the ones for other
operating systems.`}</p>
        <Steps headingDepth={3} mdxType="Steps">
          <ol>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "install-rust-1"
              }}>{`Install Rust`}</h3>
              <p parentName="li">{`Install Rust using `}<a parentName="p" {...{
                  "href": "https://rustup.rs"
                }}><inlineCode parentName="a">{`rustup`}</inlineCode></a>{`. If you don't have VC++ build
tools, the installer would prompt you to install them.`}</p>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "install-perl"
              }}>{`Install Perl`}</h3>
              <p parentName="li">{`Install `}<a parentName="p" {...{
                  "href": "https://www.perl.org/get.html#win32"
                }}>{`Perl for Windows`}</a>{`.`}</p>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "add-perl-to-your-path"
              }}>{`Add Perl to your `}<inlineCode parentName="h3">{`PATH`}</inlineCode></h3>
              <p parentName="li">{`In a Rust/MSVC environment (for example, using
`}<inlineCode parentName="p">{`x64 Native Tools Command Prompt`}</inlineCode>{`) add the binary directory of Perl
installed on the previous step to `}<inlineCode parentName="p">{`PATH`}</inlineCode>{`. For example, for default
installation of Strawberry Perl it is`}</p>
              <pre parentName="li"><code parentName="pre" {...{
                  "className": "language-bat"
                }}>{`set PATH=%PATH%;C:\\Strawberry\\perl\\bin
`}</code></pre>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "get-vectors-source-using-git"
              }}>{`Get Vector's source using `}<inlineCode parentName="h3">{`git`}</inlineCode></h3>
              <Tabs className="mini" defaultValue="latest" values={[{
                label: 'Latest (0.9.2)',
                value: 'latest'
              }, {
                label: 'Master',
                value: 'master'
              }]} mdxType="Tabs">
                <TabItem value="latest" mdxType="TabItem">
                  <pre parentName="li"><code parentName="pre" {...{
                      "className": "language-bat"
                    }}>{`git clone https://github.com/timberio/vector
git checkout v0.9.2
cd vector
`}</code></pre>
                </TabItem>
                <TabItem value="master" mdxType="TabItem">
                  <pre parentName="li"><code parentName="pre" {...{
                      "className": "language-bat"
                    }}>{`git clone https://github.com/timberio/vector
cd vector
`}</code></pre>
                </TabItem>
              </Tabs>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "build-vector-in-release-mode"
              }}>{`Build Vector in release mode`}</h3>
              <pre parentName="li"><code parentName="pre" {...{
                  "className": "language-bat"
                }}>{`set RUSTFLAGS=-Ctarget-feature=+crt-static
cargo build --no-default-features --features default-msvc --release
`}</code></pre>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "start-vector-1"
              }}>{`Start Vector`}</h3>
              <p parentName="li">{`After these steps a binary `}<inlineCode parentName="p">{`vector.exe`}</inlineCode>{` in `}<inlineCode parentName="p">{`target\\release`}</inlineCode>{` would be
created. It can be started by running`}</p>
              <pre parentName="li"><code parentName="pre" {...{
                  "className": "language-bat"
                }}>{`.\\target\\release\\vector --config config\\vector.toml
`}</code></pre>
            </li>
          </ol>
        </Steps>
      </TabItem>
      <TabItem value="docker" mdxType="TabItem">
        <p>{`It is possible to build statically linked binaries of Vector for Linux using
Docker.`}</p>
        <p>{`In this case the dependencies listed in the previous section are not
needed, as all of them would be automatically pulled by Docker.`}</p>
        <p>{`Building steps:`}</p>
        <Steps headingDepth={3} mdxType="Steps">
          <ol>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "download-vectors-source-1"
              }}>{`Download Vector's Source`}</h3>
              <Tabs className="mini" defaultValue="latest" values={[{
                label: 'Latest (0.9.2)',
                value: 'latest'
              }, {
                label: 'Master',
                value: 'master'
              }]} mdxType="Tabs">
                <TabItem value="latest" mdxType="TabItem">
                  <pre parentName="li"><code parentName="pre" {...{
                      "className": "language-bash"
                    }}>{`mkdir -p vector && \\
  curl -sSfL --proto '=https' --tlsv1.2 https://api.github.com/repos/timberio/vector/tarball/v0.9.X | \\
  tar xzf - -C vector --strip-components=1
`}</code></pre>
                </TabItem>
                <TabItem value="master" mdxType="TabItem">
                  <pre parentName="li"><code parentName="pre" {...{
                      "className": "language-bash"
                    }}>{`mkdir -p vector && \\
  curl -sSfL --proto '=https' --tlsv1.2 https://github.com/timberio/vector/archive/master.tar.gz | \\
  tar xzf - -C vector --strip-components=1
`}</code></pre>
                </TabItem>
              </Tabs>
            </li>
            <li parentName="ol">
              <h3 parentName="li" {...{
                "id": "build-vector-using-docker"
              }}>{`Build Vector using Docker`}</h3>
              <Tabs defaultValue="x86_64-unknown-linux-musl" urlKey="file_name" values={[{
                "label": "Linux (x86_64)",
                "value": "x86_64-unknown-linux-musl"
              }, {
                "label": "Linux (ARM64)",
                "value": "aarch64-unknown-linux-musl"
              }, {
                "label": "Linux (ARMv7)",
                "value": "armv7-unknown-linux-musleabihf"
              }]} mdxType="Tabs">
                <TabItem value="x86_64-unknown-linux-musl" mdxType="TabItem">
                  <pre parentName="li"><code parentName="pre" {...{
                      "className": "language-bash"
                    }}>{`PASS_FEATURES=default-cmake ./scripts/docker-run.sh builder-x86_64-unknown-linux-musl make build
`}</code></pre>
                </TabItem>
                <TabItem value="aarch64-unknown-linux-musl" mdxType="TabItem">
                  <pre parentName="li"><code parentName="pre" {...{
                      "className": "language-bash"
                    }}>{`PASS_FEATURES=default-cmake ./scripts/docker-run.sh builder-aarch64-unknown-linux-musl make build
`}</code></pre>
                </TabItem>
                <TabItem value="armv7-unknown-linux-musleabihf" mdxType="TabItem">
                  <pre parentName="li"><code parentName="pre" {...{
                      "className": "language-bash"
                    }}>{`PASS_FEATURES=default-cmake ./scripts/docker-run.sh builder-armv7-unknown-linux-musleabihf make build
`}</code></pre>
                </TabItem>
              </Tabs>
              <p parentName="li">{`The command above builds a Docker image with Rust toolchain for a Linux
target for the corresponding architecture using `}<inlineCode parentName="p">{`musl`}</inlineCode>{` as the C library,
then starts a container from this image, and then builds inside the
Container. The target binary is located in
`}<inlineCode parentName="p">{`target/<target triple>/release/vector`}</inlineCode>{` like in the previous case.`}</p>
            </li>
          </ol>
        </Steps>
      </TabItem>
    </Tabs>
    <h2 {...{
      "id": "next-steps"
    }}>{`Next Steps`}</h2>
    <h3 {...{
      "id": "configuring"
    }}>{`Configuring`}</h3>
    <p>{`The Vector configuration file is located at:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`config/vector.toml
`}</code></pre>
    <p>{`A full spec is located at `}<inlineCode parentName="p">{`config/vector.spec.toml`}</inlineCode>{` and examples are
located in `}<inlineCode parentName="p">{`config/vector/examples/*`}</inlineCode>{`. You can learn more about configuring
Vector in the `}<a parentName="p" {...{
        "href": "/docs/setup/configuration/"
      }}>{`Configuration`}</a>{` section.`}</p>
    <h3 {...{
      "id": "data-directory"
    }}>{`Data Directory`}</h3>
    <p>{`We highly recommend creating a `}<a parentName="p" {...{
        "href": "/docs/reference/global-options/#data_dir"
      }}>{`data directory`}</a>{`
that Vector can use:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`mkdir /var/lib/vector
`}</code></pre>
    <Alert type="warning" mdxType="Alert">
      <p>{`Make sure that this directory is writable by the `}<inlineCode parentName="p">{`vector`}</inlineCode>{` process.`}</p>
    </Alert>
    <p>{`Vector offers a global `}<a parentName="p" {...{
        "href": "/docs/reference/global-options/#data_dir"
      }}><inlineCode parentName="a">{`data_dir`}</inlineCode>{` option`}</a>{` that
you can use to specify the path of your directory.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-toml",
        "metastring": "title=\"vector.toml\"",
        "title": "\"vector.toml\""
      }}>{`data_dir = "/var/lib/vector" # default
`}</code></pre>
    <h3 {...{
      "id": "service-managers"
    }}>{`Service Managers`}</h3>
    <p>{`Vector archives ship with service files in case you need them:`}</p>
    <h4 {...{
      "id": "initd"
    }}>{`Init.d`}</h4>
    <p>{`To install Vector into Init.d run:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`cp -av distribution/init.d/vector /etc/init.d
`}</code></pre>
    <h4 {...{
      "id": "systemd"
    }}>{`Systemd`}</h4>
    <p>{`To install Vector into Systemd run:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`cp -av distribution/systemd/vector.service /etc/systemd/system
`}</code></pre>
    <h3 {...{
      "id": "updating"
    }}>{`Updating`}</h3>
    <p>{`Simply follow the same `}<a parentName="p" {...{
        "href": "#installation"
      }}>{`installation instructions above`}</a>{`.`}</p>
    <h2 {...{
      "id": "how-it-works"
    }}>{`How It Works`}</h2>
    <h3 {...{
      "id": "feature-flags"
    }}>{`Feature Flags`}</h3>
    <p>{`The following feature flags are supported via the `}<inlineCode parentName="p">{`FEATURES`}</inlineCode>{` env var when
executing `}<inlineCode parentName="p">{`make build`}</inlineCode>{`:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`[FEATURES="<flag1>,<flag2>,..."] make build
`}</code></pre>
    <p>{`There are three meta-features which can be used when compiling for the
corresponding targets. If no features are specified, then the `}<inlineCode parentName="p">{`default`}</inlineCode>{` one is
used.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Feature`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Description`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Enabled by default`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`default`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Default set of features for `}<inlineCode parentName="td">{`*-unknown-linux-gnu`}</inlineCode>{` and `}<inlineCode parentName="td">{`*-apple-darwin`}</inlineCode>{` targets.`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><i className="feather icon-check"></i></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`default-cmake`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Default set of features for `}<inlineCode parentName="td">{`*-unknown-linux-*`}</inlineCode>{` targets which uses `}<inlineCode parentName="td">{`cmake`}</inlineCode>{` and `}<inlineCode parentName="td">{`perl`}</inlineCode>{` as build dependencies.`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`default-msvc`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Default set of features for `}<inlineCode parentName="td">{`*-pc-windows-msvc`}</inlineCode>{` targets. Requires `}<inlineCode parentName="td">{`cmake`}</inlineCode>{` and `}<inlineCode parentName="td">{`perl`}</inlineCode>{` as build dependencies.`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}></td>
        </tr>
      </tbody>
    </table>
    <p>{`Alternatively, for finer control over dependencies and operating system
features, it is possible to use specific features from the list below:`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Feature`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Description`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Included in `}<inlineCode parentName="th">{`default`}</inlineCode>{` feature`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`unix`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Enables features that require `}<inlineCode parentName="td">{`cfg(unix)`}</inlineCode>{` to be present on the platform, namely support for Unix domain sockets in `}<a parentName="td" {...{
              "href": "/docs/reference/sources/docker/"
            }}>{`docker`}</a>{` source and `}<a parentName="td" {...{
              "href": "https://github.com/jemalloc/jemalloc"
            }}>{`jemalloc`}</a>{` instead of the default memory allocator.`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><i className="feather icon-check"></i></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`vendored`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Forces vendoring of `}<a parentName="td" {...{
              "href": "https://www.openssl.org/"
            }}>{`OpenSSL`}</a>{` and `}<a parentName="td" {...{
              "href": "https://www.zlib.net"
            }}>{`ZLib`}</a>{` dependencies instead of using their versions installed in the system. Requires `}<inlineCode parentName="td">{`perl`}</inlineCode>{` as a build dependency.`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><i className="feather icon-check"></i></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`leveldb-plain`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Enables support for `}<a parentName="td" {...{
              "href": "/docs/meta/glossary/#buffer"
            }}>{`disk buffers`}</a>{` using vendored `}<a parentName="td" {...{
              "href": "https://github.com/google/leveldb"
            }}>{`LevelDB`}</a>{`.`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><i className="feather icon-check"></i></td>
        </tr>
